import logo from './logo.svg';
import './App.css';
import { ComponenteConFragment } from './ComponenteConFragment';
import { ComponenteConDiv } from './ComponenteConDiv';
import { VariablesEnComponentes } from './VariablesEnComponentes';
import InterpolarVariablesEnComponentes from './InterpolarVariablesEnComponentes';
import { ComunicacionComponentes } from './ComunicacionComponentes';

function App() {
  return (
    <div className="App">
      <ComponenteConFragment></ComponenteConFragment>
      <ComponenteConDiv></ComponenteConDiv>
      <VariablesEnComponentes></VariablesEnComponentes>
      <InterpolarVariablesEnComponentes></InterpolarVariablesEnComponentes> 
      <ComunicacionComponentes nombre="Daniel" apellido="Alvarez"></ComunicacionComponentes>
    </div>
  );
}

export default App;
